import styled from "styled-components"

export const Wrapper = styled.div`

`; 
export const Style = styled.h2`
    font-size: 40px;
    line-height: 35px;
    color: #000000;
    padding-bottom: 20px;
    img {
        width: 40px;
    }
`; 
export const Base = styled.div`
    padding: 20px;
    background: #272343;
    border-radius: 5px;
    color: #FFFFFE;
    margin-bottom: 16px;
    max-width: 50%;
    margin-right: auto;
`; 

export const Title = styled.h3`
    font-size: 30px;
    line-height: 44px;
    margin-bottom: 4px;
`; 

export const Artist = styled.p`
    font-size: 18px;
    line-height: 22px;
    background: #272343;
    border-radius: 5px;
`;
